Final pieces in place for #Quatermass70. 
It’s such a thrill to be sharing the bill with his lot (pictured here with their original counterparts). 
I think the cast assembled is absolutely incredible : but that’s what a good script and company will do for you. 

@charliedemelo as Dr Gordon Briscoe (originally John Glen)
@coxitude as Charles Greene (Peter Bathurst)
@tombellforever as Dr Ludwig Reichenheim (Sir Christopher Rhodes)
Jason Morell (son of Quatermass himself, Andre Morell) as Jackson, News Editor (Oliver Johnston)
Chris Jack as DS Best (Frank Hawkins)

Come to @yourallypally on Saturday. It’s going to be very special. 

